//     * trip_days : [{"id":837677,"trip_date":"2015-04-24","day":1,"updated_at":1434571646,"":null,"nodes":[{"id":1900752,"row_order":0,"score":0,"comment":null,"tips":null,"memo":{},"entry_id":null,"lat":0,"lng":0,"entry_type":null,"user_entry":false,"entry_name":null,"attraction_type":null,"updated_at":1434438909,"notes":[{"id":10663619,"row_order":0,"layout":"full","col":0,"description":"陈丹燕的一段话，想放在这里做开篇。\r\n\u201c有时我要长风万里，有时我要归于内心。有时我要抹去自己身上所有身份的痕迹，就渴望当一个透明的人。有时万里、十万里之外，竟然回到的是自己的内心。\u201d\r\n\r\n曾经对巴黎的场景幻想，是身后有怀抱，耳边有软语。\r\n这么多年过去，错的人对的人轮番走过，有时难免孤独，但错过的人也许注定远航\r\n那你又怎能停留在原地\r\n疗伤不如旅行，治愈不如开阔。\r\n走在大地的脉络间，我守着自己的生命轨迹。\r\n温柔笃定的，想你。","updated_at":1434433056}]},{"id":1900755,"row_order":4194304,"score":0,"comment":null,"tips":null,"memo":{},"entry_id":363757,"lat":0,"lng":0,"entry_type":"Attraction","user_entry":true,"entry_name":"迪拜机场","attraction_type":null,"updated_at":1434438909,"notes":[{"id":10663651,"row_order":-4194303,"layout":"full","col":0,"description":"北京飞迪拜9个小时，迪拜飞巴黎6个小时，飞过欧亚大陆，一路追过6小时时差，奔向亚平年半岛，一路昏睡，偶尔醒来时，黑暗正好，一直期待黎明。\r\n\r\n","updated_at":1434433166},{"id":10663603,"row_order":0,"layout":"full","col":1,"description":null,"updated_at":1434433134,"photo":{"id":9836595,"image_width":1600,"image_height":1066,"image_file_size":351459,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429865971,"url":"http://p.chanyouji.cn/295105/1434432215182p19ntd54b11i35f2q1uuq156c14al3.jpg"}}]},{"id":1900756,"row_order":6291456,"score":0,"comment":null,"tips":null,"memo":{},"entry_id":363758,"lat":0,"lng":0,"entry_type":"Attraction","user_entry":true,"entry_name":"chalete 夏特勒","attraction_type":null,"updated_at":1434438909,"notes":[{"id":10663652,"row_order":-4194303,"layout":"full","col":0,"description":"机长的广播把我们从恍惚中唤醒，活动下酸痛不已的四肢，望眼四周，全是些惺忪茫然的眼神，十几小时的飞行总算要结束了。拉开遮光板，天际线上晕染出一段好看的橘黄色，想拿出相机给它留下一个美丽的回忆，想想还是作罢了。迎着法兰西的艳阳，我们稳稳的降落在CHARLES DE GAULLE AIRPORT，一切都很顺利，远比其它地方的入境简单轻松，甚至连机场海关的人都知道用中文\u201c你好\u201d跟我们打招呼，希望不久中文能成国际通用语言就好了。当地时间下午13：30到达，如此正好是犯困的北京时间，少女之心浪漫的起点之地啊啊啊，心里真是乱激动一把，我甚至想到十年前我在电视里看到的那以为遥不可及的铁塔，而现在我终于站在了铁塔所在的地方，巴黎！","updated_at":1434433194},{"id":10663606,"row_order":0,"layout":"full","col":1,"description":null,"updated_at":1434433194,"photo":{"id":9836598,"image_width":1200,"image_height":1600,"image_file_size":463193,"exif_lat":"48.8645027778","exif_lng":"2.3466444444","exif_date_time_original":1430035206,"url":"http://p.chanyouji.cn/295105/1434432219358p19ntd54b1kjd5g41go412p41ntj6.jpg"}},{"id":10663768,"row_order":3145728,"layout":"full","col":2,"description":"在铁塔附近，还是卢浮宫附近? \r\n因为这回只有三天的时间在巴黎，考虑到要去的地方都集中在地铁1、2、4，7，就把房间订在所在的夏特勒区，Airbnb 上订的民宿： Feel at home in the heart of Paris!\r\nhttps://zh.airbnb.com/rooms/1876098 \r\n这个街区晚上还蛮不错，宁静安全，楼下的美食街基本各国美食都有，中餐，日料，意大利餐......超市，药房，花店。","updated_at":1471893860},{"id":10663537,"row_order":4194304,"layout":"full","col":3,"description":null,"updated_at":1434439237,"photo":{"id":9836567,"image_width":1187,"image_height":592,"image_file_size":119634,"exif_lat":"0.0","exif_lng":"0.0","exif_date_time_original":0,"url":"http://p.chanyouji.cn/295105/1434431768713p19ntcni388877b1mfv3ktt9a2.jpg"}},{"id":10663803,"row_order":5242880,"layout":"full","col":4,"description":"在戴高乐机场T2买了博物馆的通票。\r\n比较受欢迎的景点可以用通票的包括：巴黎圣母院（钟楼、但是需要排队）、卢浮宫、奥赛博物馆、蓬皮杜中心、凯旋门。\r\n大部分可以使用通票的景点都允许通票持有者直接进入而不用排队，排除的大部分都是在买票的。\r\n","updated_at":1434529033},{"id":10663769,"row_order":6291456,"layout":"full","col":5,"description":"\"到 了巴黎这个城市，我认为最惬意的事就是在城里乱逛了。走在大街上看房子，看人，看街旁的雕塑，看看商店的橱窗，逛逛塞纳河两岸无数文豪驻足过的旧书摊，再 随意坐在路旁露天的咖啡馆吃点喝点。或者干脆随便登上一艘塞纳河上的游船，来一次浪漫之旅，看两岸古老的建筑一一划过，倾听伴着舒缓的古典音乐传来的导游 优雅的解说。然而，如果只是这样的话，回来讲给朋友听，我这样的旅行一定会被视为浪费。在巴黎这样一个艺术之都，如果说真的只有闲逛，那恐怕连我自己也会后悔。\"\r\n哈哈，不过第一天我们什么也没干，本想塞纳河上的日落，还是被可恶的时差打败，吃过饭就回去睡觉了。","updated_at":1434439237},{"id":10663232,"row_order":7340032,"layout":"full","col":6,"description":"楼下风景","updated_at":1434439237,"photo":{"id":9836272,"image_width":1600,"image_height":1061,"image_file_size":402286,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429979987,"url":"http://p.chanyouji.cn/295105/1434430383135p19ntbd8v71pfn17vlsnbfo01tb42.jpg"}}]}]},{"id":837652,"trip_date":"2015-04-25","day":2,"updated_at":1434571646,"destination":{"id":188,"name_zh_cn":"巴黎"},"nodes":[{"id":1900695,"row_order":0,"score":0,"comment":null,"tips":null,"memo":{},"entry_id":null,"lat":0,"lng":0,"entry_type":null,"user_entry":false,"entry_name":null,"attraction_type":null,"updated_at":1434438909,"notes":[{"id":10663786,"row_order":0,"layout":"full","col":0,"description":"巴黎是个很多地标的城市，埃菲尔铁塔、卢浮宫与玻璃金字塔、凯旋门与新凯旋门、凡尔赛宫和很多其他大大小小的宫殿园林。即使光谈教堂，也有巴黎圣母院和蒙马特的圣心大教堂两座，大抵世上很难再找出一个城市，有如此多世人皆知的地标。\r\n巴黎圣母院是一座不太大的教堂，是 西方最大的宗教建筑，这个纪录保持了近一百年。建筑风格上，圣母院为全盛时期的哥特式，虽然没有高耸的尖塔，但圆窗、尖拱顶、飞扶壁这些典型的哥特元素， 还是比比皆是。","updated_at":1471893924}]},{"id":1900703,"row_order":4194304,"score":0,"comment":null,"tips":null,"memo":{},"entry_id":94152,"lat":48.853296,"lng":2.349133,"entry_type":"Attraction","user_entry":false,"entry_name":"巴黎圣母院","attraction_type":null,"updated_at":1434438909,"notes":[{"id":10663233,"row_order":-7549747,"layout":"topHeavySplit","col":0,"description":null,"updated_at":1434527327,"photo":{"id":9836273,"image_width":1600,"image_height":1082,"image_file_size":320554,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429981848,"url":"http://p.chanyouji.cn/295105/1434430385043p19ntbd8v7agpi8hoqfu94a1q3.jpg"}},{"id":10663234,"row_order":-6710887,"layout":"topHeavySplit","col":0,"description":null,"updated_at":1434527327,"photo":{"id":9836274,"image_width":1600,"image_height":1066,"image_file_size":443460,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429982562,"url":"http://p.chanyouji.cn/295105/1434430386165p19ntbd8v71nbh1oir9hr1q5a1pfc4.jpg"}},{"id":10663235,"row_order":-5872027,"layout":"topHeavySplit","col":0,"description":null,"updated_at":1434527327,"photo":{"id":9836275,"image_width":1600,"image_height":1066,"image_file_size":637605,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429983509,"url":"http://p.chanyouji.cn/295105/1434430387800p19ntbd8v71um51sg51psavdgt8l5.jpg"}},{"id":10663787,"row_order":-5033167,"layout":"full","col":1,"description":"我们的巴黎之旅以圣母院开始。因为在BNB等人来修燃气管道一直到修理结束耽误了时间。圣母院前已是人山人海，我们九点半去到，队伍已经排到后院里饶了一圈。看到如此浩大的人流，我们于是决定去周边先转转，绕到圣母院的后面，看到有一队比较人少， 打听之后才知道这只是钟楼的队。没办法，在排了30分钟后根本没有往前挪动的痕迹又放弃。","updated_at":1434527327},{"id":10663236,"row_order":-4194307,"layout":"bottomHeavy","col":2,"description":null,"updated_at":1434527327,"photo":{"id":9836276,"image_width":1600,"image_height":1066,"image_file_size":620386,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429983792,"url":"http://p.chanyouji.cn/295105/1434430390061p19ntbd8v7i9c1abj17f31c1f1ql6.jpg"}},{"id":10663237,"row_order":-3355447,"layout":"bottomHeavy","col":2,"description":null,"updated_at":1434527327,"photo":{"id":9836277,"image_width":1600,"image_height":1066,"image_file_size":619658,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429983796,"url":"http://p.chanyouji.cn/295105/1434430392140p19ntbd8v76op2fpmomgjjogl7.jpg"}},{"id":10673804,"row_order":-2516587,"layout":"full","col":3,"description":"透过鲜花看到公园里一簇簇葱郁的绿色， 路边的情侣走着走着停下来，拥抱在一起。\r\n我想，这就是巴黎吧。","updated_at":1434527327},{"id":10663238,"row_order":-1677727,"layout":"topHeavy","col":4,"description":null,"updated_at":1434527327,"photo":{"id":9836278,"image_width":1066,"image_height":1600,"image_file_size":517390,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429984432,"url":"http://p.chanyouji.cn/295105/1434430393794p19ntbd8v71ncia1c1h581b9c1th08.jpg"}},{"id":10663239,"row_order":-838867,"layout":"topHeavy","col":4,"description":null,"updated_at":1434527327,"photo":{"id":9836279,"image_width":1600,"image_height":1066,"image_file_size":518486,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429984730,"url":"http://p.chanyouji.cn/295105/1434430395253p19ntbd8v7j4b1816f5q1hm51b0r9.jpg"}},{"id":10674290,"row_order":-7,"layout":"full","col":5,"description":"圣母院后面塞纳河上有一座桥，栏杆上居然也锁满了各式各样的锁，有些写着名字，有些写着简短的话。每把锁，都寄托了天长地久的希望。","updated_at":1434527327},{"id":10663240,"row_order":838853,"layout":"equally","col":6,"description":null,"updated_at":1434527327,"photo":{"id":9836280,"image_width":1600,"image_height":1066,"image_file_size":295488,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429986991,"url":"http://p.chanyouji.cn/295105/1434430396471p19ntbd8v7184n13gu1g8jac5vena.jpg"}},{"id":10663241,"row_order":1677713,"layout":"equally","col":6,"description":null,"updated_at":1434527327,"photo":{"id":9836281,"image_width":1600,"image_height":1086,"image_file_size":298374,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429987112,"url":"http://p.chanyouji.cn/295105/1434430397541p19ntbd8v8jquode1bpa171110hqb.jpg"}},{"id":10663242,"row_order":2516573,"layout":"equally","col":6,"description":null,"updated_at":1434527327,"photo":{"id":9836282,"image_width":1600,"image_height":1066,"image_file_size":584992,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429987358,"url":"http://p.chanyouji.cn/295105/1434430398715p19ntbd8v86vlb5o1lfl471l17c.jpg"}},{"id":10674293,"row_order":7549733,"layout":"full","col":7,"description":"巴黎圣母院两旁就是塞纳河，它就坐落在塞纳河上的西岱岛上，最早的巴黎，就是从这个西岱岛起步，然后慢慢走到了今天。\r\n过桥，从河对岸看西岱岛上的巴黎圣母院，几百年前身姿，依然那么俊美。在阴沉的天空和树木衬托下，巴黎圣母院呈现一种我想象中的中世纪时期欧洲的冷峻和萧瑟。","updated_at":1434529338},{"id":10663243,"row_order":8380416,"layout":"full","col":8,"description":null,"updated_at":1434529338,"photo":{"id":9836283,"image_width":1600,"image_height":1066,"image_file_size":313210,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429987444,"url":"http://p.chanyouji.cn/295105/1434430400915p19ntbd8v81so7h2hpbvku313itd.jpg"}},{"id":10663244,"row_order":8384512,"layout":"full","col":9,"description":null,"updated_at":1434529338,"photo":{"id":9836284,"image_width":1600,"image_height":1042,"image_file_size":350111,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429987801,"url":"http://p.chanyouji.cn/295105/1434430402236p19ntbd8v8eg0eik9vov9n1bpde.jpg"}},{"id":10674294,"row_order":8385536,"layout":"full","col":10,"description":"这时，一对当代的情侣搂腰沿着塞纳河慢慢走入画面，把我的思绪一下子从中世纪的欧洲拉到了此情此景。","updated_at":1434529338},{"id":10663245,"row_order":8386560,"layout":"full","col":11,"description":null,"updated_at":1434529338,"photo":{"id":9836285,"image_width":1600,"image_height":1066,"image_file_size":452151,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429987985,"url":"http://p.chanyouji.cn/295105/1434430403421p19ntbd8v89i819jq1q1taje1j7qf.jpg"}},{"id":10663604,"row_order":8387584,"layout":"full","col":12,"description":null,"updated_at":1434529338,"photo":{"id":9836596,"image_width":1200,"image_height":1600,"image_file_size":501824,"exif_lat":"48.8517388889","exif_lng":"2.3516138889","exif_date_time_original":1429966265,"url":"http://p.chanyouji.cn/295105/1434432216426p19ntd54b116qsfko1afdkqdgs4.jpg"}}]},{"id":1900758,"row_order":5242880,"score":0,"comment":null,"tips":null,"memo":{},"entry_id":363759,"lat":0,"lng":0,"entry_type":"Attraction","user_entry":true,"entry_name":"L'Escargot Montorgueil 餐厅","attraction_type":null,"updated_at":1434438909,"notes":[{"id":10664659,"row_order":-4194303,"layout":"full","col":0,"description":"位于巴黎老食街上已经有180年历史的L\u2018Escargot Montorguel蜗牛餐厅， 蒜香ail、咖喱Curry、奶酪Roquefort三种口味的蜗牛是主打，当然也吸引着来自世界各地的游客。\r\n排队是常事，餐厅的服务很到位，在这样的地方享用一道地道的法餐，也不枉费此行吧。","updated_at":1434438547},{"id":10663247,"row_order":0,"layout":"full","col":1,"description":null,"updated_at":1434438547,"photo":{"id":9836287,"image_width":1600,"image_height":1066,"image_file_size":227885,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429993445,"url":"http://p.chanyouji.cn/295105/1434430406172p19ntbd8v81qus11r618cv97r2ibh.jpg"}},{"id":10663248,"row_order":4194304,"layout":"full","col":2,"description":null,"updated_at":1434438547,"photo":{"id":9836288,"image_width":1066,"image_height":1600,"image_file_size":452570,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429996235,"url":"http://p.chanyouji.cn/295105/1434430407210p19ntbd8v819imvdtg87eu81kpfi.jpg"}}]},{"id":1900704,"row_order":6291456,"score":0,"comment":null,"tips":null,"memo":{},"entry_id":94163,"lat":48.858278,"lng":2.294254,"entry_type":"Attraction","user_entry":false,"entry_name":"埃菲尔铁塔","attraction_type":null,"updated_at":1434438909,"notes":[{"id":10664697,"row_order":-4194303,"layout":"full","col":0,"description":"\"If you are lucky enough to have lived in Paris as a young man, then wherever you go for the rest of your life, it stays with you, for Paris is a moveable feast.\"","updated_at":1434439589},{"id":10663249,"row_order":0,"layout":"bottomHeavySplit","col":1,"description":null,"updated_at":1434439589,"photo":{"id":9836289,"image_width":1600,"image_height":1066,"image_file_size":515044,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429999526,"url":"http://p.chanyouji.cn/295105/1434430408591p19ntbd8v817kq14v8236ocv1s9vj.jpg"}},{"id":10663250,"row_order":4194304,"layout":"bottomHeavySplit","col":1,"description":null,"updated_at":1434439589,"photo":{"id":9836290,"image_width":1600,"image_height":1066,"image_file_size":505594,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429999960,"url":"http://p.chanyouji.cn/295105/1434430410062p19ntbd8v813amu8efrjngs1ta7k.jpg"}},{"id":10663251,"row_order":6291456,"layout":"bottomHeavySplit","col":1,"description":null,"updated_at":1434439589,"photo":{"id":9836291,"image_width":1251,"image_height":1600,"image_file_size":604873,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430000311,"url":"http://p.chanyouji.cn/295105/1434430411723p19ntbd8v8sj59i310bra3b1leil.jpg"}},{"id":10664674,"row_order":6815744,"layout":"full","col":2,"description":"登埃菲尔铁塔的门票是可以从网上预订，需要提前选好参观时段，最多允许迟到半小时。\r\n我一惯的不擅长计划，所以都是到了当时看情况与心境而订。\r\n也有特别入口，电梯吞吐量也不小，不用担心因为排队而排掉了那半小 时。铁塔的电梯系统，四个角有四台，从地面直通中间层，但登顶的一段则需要额外排队，旺季需要半个小时以上。所以如果是扑黄昏时段上去看日落，抵达中间层 时天色已经昏暗的话，就不妨在那层一直呆到天黑。因为排队的话也要排到天黑的。当然夜景是绝对的赞，天黑了也影响不大。","updated_at":1434439589},{"id":10663252,"row_order":7340032,"layout":"topHeavy","col":3,"description":null,"updated_at":1434439589,"photo":{"id":9836292,"image_width":1600,"image_height":1066,"image_file_size":393017,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430000702,"url":"http://p.chanyouji.cn/295105/1434430413318p19ntbd8v81fhj61l1pvlrbleanm.jpg"}},{"id":10663253,"row_order":7864320,"layout":"topHeavy","col":3,"description":null,"updated_at":1434439589,"photo":{"id":9836293,"image_width":1600,"image_height":1026,"image_file_size":358243,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430002771,"url":"http://p.chanyouji.cn/295105/1434430414668p19ntbd8v8rs91qrm1fgc13sjoa2n.jpg"}},{"id":10663254,"row_order":8126464,"layout":"topHeavy","col":3,"description":null,"updated_at":1434439589,"photo":{"id":9836294,"image_width":1600,"image_height":1066,"image_file_size":125421,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430003362,"url":"http://p.chanyouji.cn/295105/1434430415912p19ntbd8v81ht6u0d1qo919rsqb2o.jpg"}},{"id":10674507,"row_order":8192000,"layout":"full","col":4,"description":"铁塔建在战神广场靠近塞纳河的西北端，铁塔的东南边是碧油油的草地和高树。草地中有两排修剪得非常整齐的绿树，我叫不出这树的名字，树身修成四方，犹如两队穿着盔甲的勇士站立两旁。\r\n战神广场的东南边是军事学院，战神广场可能就是原来军事学院学生操演的地方，所以这广场又称为战神校场，现在当然不再用来做操场了。\r\n铁塔的西北边就是塞纳河，河那边是公园。铁塔的脚下立着一尊铜质半身雕像，这就是铁塔的设计者居斯塔夫﹒埃菲尔。我们从他身边走过，他那睿智的眼光正在告诉我们：创新是永恒的基本要素。埃菲尔是桥梁工程师，他设计了不少桥梁，但是真正使他获得永恒的是他以创新的理念和创新的实践成就了这一杰作\u2014\u2014铁塔。","updated_at":1434529338},{"id":10663266,"row_order":8257536,"layout":"full","col":5,"description":null,"updated_at":1434529338,"photo":{"id":9836295,"image_width":1600,"image_height":1066,"image_file_size":441222,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430006727,"url":"http://p.chanyouji.cn/295105/1434430416930p19ntbd8v8pr71au17e0m23ru6p.jpg"}},{"id":10663267,"row_order":8323072,"layout":"full","col":6,"description":null,"updated_at":1434529338,"photo":{"id":9836298,"image_width":1600,"image_height":1066,"image_file_size":336309,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430006956,"url":"http://p.chanyouji.cn/295105/1434430419430p19ntbd8v8bje1lq5c4bma3tabq.jpg"}},{"id":10674505,"row_order":8355840,"layout":"full","col":7,"description":"真的，在巴黎，你要想看不见埃菲尔铁塔，就得时时处处当心。不管什么季节，不管是云雾弥漫、薄云蔽日、阴天、雨天，还是风和日丽，不管你在哪里，也不管有哪一片屋顶、教堂或树叶，把你和它隔开，铁塔总在那儿。它已融入了人们的日常生活，也许我们不再能赋予它任何特殊属性，它简直就是注定了要像一块岩石或一条河流那样存在着，因此干脆成了一种自然现象，其意义虽可不断质疑，其存在却不容争辩。","updated_at":1434529338}]},{"id":1900757,"row_order":6815744,"score":0,"comment":null,"tips":null,"memo":{},"entry_id":94159,"lat":48.852597,"lng":2.348452,"entry_type":"Attraction","user_entry":false,"entry_name":"塞纳河","attraction_type":null,"updated_at":1461328415,"notes":[{"id":10664696,"row_order":-4194303,"layout":"full","col":0,"description":"\u201c塞纳河是巴黎的幸运。它不宽，也不窄。河水静静地、和缓地流响。","updated_at":1434439561},{"id":10663268,"row_order":0,"layout":"full","col":1,"description":null,"updated_at":1434439561,"photo":{"id":9836300,"image_width":1600,"image_height":1114,"image_file_size":326150,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430007091,"url":"http://p.chanyouji.cn/295105/1434430421721p19ntbd8v8j42i2b1ruh1t44h3nr.jpg"}},{"id":10663269,"row_order":4194304,"layout":"full","col":2,"description":null,"updated_at":1434439561,"photo":{"id":9836302,"image_width":1600,"image_height":1032,"image_file_size":276195,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430007178,"url":"http://p.chanyouji.cn/295105/1434430422918p19ntbd8v8g08ff314ol1223kpts.jpg"}}]},{"id":1900705,"row_order":7340032,"score":4,"comment":"乘坐地铁M4、M6、M12、M13线在Montparnasse - Bienvenüe站下可以到达。除了顶楼的观景 平台外，55层的Ciel de Paris餐厅也是一个好选择","tips":null,"memo":{"time_unit":"minute","price_amount":"","time":"","price_currency":"CNY"},"entry_id":154844,"lat":48.842036,"lng":2.321891,"entry_type":"Attraction","user_entry":false,"entry_name":"蒙帕纳斯大厦","attraction_type":null,"updated_at":1486816222,"notes":[{"id":10664065,"row_order":-5242879,"layout":"full","col":0,"description":"巴黎市区有若干可以登高望远的地方，比较矮的有凯旋门、巴黎圣母院和蓬皮杜艺术中心，比较高的就只有圣心大教堂、蒙帕纳斯大楼和埃菲尔铁塔。","updated_at":1471894040},{"id":10663270,"row_order":-4194303,"layout":"bottomHeavySplit","col":1,"description":null,"updated_at":1434439237,"photo":{"id":9836304,"image_width":1600,"image_height":1066,"image_file_size":448584,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430008516,"url":"http://p.chanyouji.cn/295105/1434430424322p19ntbd8v8u8e18sd1ofj16bn13dht.jpg"}},{"id":10663271,"row_order":0,"layout":"bottomHeavySplit","col":1,"description":null,"updated_at":1434439237,"photo":{"id":9836307,"image_width":1600,"image_height":1018,"image_file_size":276880,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430014139,"url":"http://p.chanyouji.cn/295105/1434430425825p19ntbd8v81aq4odb38356egsvu.jpg"}},{"id":10663272,"row_order":4194304,"layout":"bottomHeavySplit","col":1,"description":null,"updated_at":1434439237,"photo":{"id":9836309,"image_width":1600,"image_height":972,"image_file_size":587951,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430014310,"url":"http://p.chanyouji.cn/295105/1434430428584p19ntbd8v8pjt6281pdltud1sldv.jpg"}},{"id":10664632,"row_order":5242880,"layout":"full","col":2,"description":"巴黎人流传着一个笑话：\u201c蒙帕纳斯大楼是巴黎视野最美的地方，因为这里是全巴黎唯一看不见这座大楼的地方\u201d。\r\n在大楼的第56层是专为游客设计的，防雨和防风设计，冬暖夏凉，游客可以通过大型玻璃窗欣赏巴黎最美的风景。360度全景尽收眼底，巴 黎的大道、屋顶、建筑物、公园等等整个巴黎在您脚下！搭乘全世界最快的电梯之一直达观光楼层，只需要38秒。59层距离地面有201米，天气晴朗时，从 59层的观景平台能见度可达到40公里。 蒙帕纳斯大楼建成后被市民嗤之以鼻，最后有人提议把她保留下来做反面教材，此后市区内不再建高楼，如今反而成了俯瞰巴黎全景的一个好选择。","updated_at":1471894084},{"id":10663273,"row_order":6291456,"layout":"full","col":3,"description":null,"updated_at":1434439237,"photo":{"id":9836310,"image_width":1600,"image_height":1038,"image_file_size":331291,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430017461,"url":"http://p.chanyouji.cn/295105/1434430430053p19ntbd8v817r1opfebsp951tsa10.jpg"}}]},{"id":1900706,"row_order":7864320,"score":0,"comment":null,"tips":null,"memo":{},"entry_id":167533,"lat":48.843097,"lng":2.326524,"entry_type":"Attraction","user_entry":false,"entry_name":"蒙巴纳斯大街","attraction_type":"restaurant","updated_at":1434438909,"notes":[{"id":10663305,"row_order":0,"layout":"full","col":0,"description":null,"updated_at":1434432803,"photo":{"id":9836344,"image_width":1600,"image_height":1066,"image_file_size":310101,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430018706,"url":"http://p.chanyouji.cn/295105/1434430503266p19ntbd8v86h811r2j2cjahhb11.jpg"}}]}]},{"id":837658,"trip_date":"2015-04-26","day":3,"updated_at":1434571646,"destination":{"id":188,"name_zh_cn":"巴黎"},"nodes":[{"id":1900701,"row_order":0,"score":0,"comment":null,"tips":null,"memo":{},"entry_id":null,"lat":0,"lng":0,"entry_type":null,"user_entry":false,"entry_name":null,"attraction_type":null,"updated_at":1434438909,"notes":[]},{"id":1900759,"row_order":2097152,"score":0,"comment":null,"tips":null,"memo":{},"entry_id":363760,"lat":0,"lng":0,"entry_type":"Attraction","user_entry":true,"entry_name":"夏特勒","attraction_type":null,"updated_at":1434438909,"notes":[{"id":10663246,"row_order":-4194304,"layout":"full","col":0,"description":null,"updated_at":1434530153,"photo":{"id":9836286,"image_width":1600,"image_height":1066,"image_file_size":410553,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429989425,"url":"http://p.chanyouji.cn/295105/1434430404849p19ntbd8v8q8m1jgc1j791tukr5tg.jpg"}},{"id":10674656,"row_order":4194302,"layout":"full","col":1,"description":null,"updated_at":1434530153,"photo":{"id":9845987,"image_width":1200,"image_height":1600,"image_file_size":452451,"exif_lat":"48.866325","exif_lng":"2.3472444444","exif_date_time_original":1430034882,"url":"http://p.chanyouji.cn/295105/1434529310226p19o09o9f3mdm1ufkpii2fi1vlm2.jpg"}}]},{"id":1900712,"row_order":4194304,"score":0,"comment":null,"tips":null,"memo":{},"entry_id":363746,"lat":0,"lng":0,"entry_type":"Attraction","user_entry":true,"entry_name":"罗浮宫， 巴黎","attraction_type":null,"updated_at":1434438909,"notes":[{"id":10663783,"row_order":-6291455,"layout":"full","col":0,"description":"如果非要选择一个拒绝阳光和风的旅行，我个人认为卢浮宫比埃菲尔铁塔、凯旋门和巴黎圣母院有更多的理由吸引我。埃菲尔铁塔和凯旋门是一种象征，一种国家历史的标志；巴黎圣母院是一个凝重的精神世界；而卢浮宫则是一幅长卷，是可以浮光掠影，也可以一步三叹的书。\u201d","updated_at":1434433993},{"id":10663306,"row_order":-4194303,"layout":"equally","col":1,"description":null,"updated_at":1434433993,"photo":{"id":9836345,"image_width":1600,"image_height":1008,"image_file_size":265766,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430061024,"url":"http://p.chanyouji.cn/295105/1434430504439p19ntbd8v81a5d1a531bqelh6s4t12.jpg"}},{"id":10663274,"row_order":0,"layout":"equally","col":1,"description":null,"updated_at":1434433993,"photo":{"id":9836313,"image_width":1600,"image_height":1066,"image_file_size":240405,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430062259,"url":"http://p.chanyouji.cn/295105/1434430433644p19ntbd8v817u2u7l16ho1lfbkkn13.jpg"}},{"id":10663275,"row_order":4194304,"layout":"full","col":2,"description":null,"updated_at":1434433994,"photo":{"id":9836314,"image_width":1066,"image_height":1600,"image_file_size":228822,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430062277,"url":"http://p.chanyouji.cn/295105/1434430434833p19ntbd8v84jf1mchielh0jmgs14.jpg"}},{"id":10663974,"row_order":5242880,"layout":"full","col":3,"description":"所有去过的人都说，卢浮宫太大了，根本无法走完。又因为卢浮宫太大了，在里边丈二和尚摸不着头脑。我们之前做功课的时候打印了卢浮宫官网的\u201c卢浮宫馆藏杰作\u201d，果然依说明两小时完事，还算是特别有用的攻略。","updated_at":1471894123},{"id":10663276,"row_order":6291456,"layout":"topHeavy","col":4,"description":null,"updated_at":1434435486,"photo":{"id":9836316,"image_width":1066,"image_height":1600,"image_file_size":450463,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430062444,"url":"http://p.chanyouji.cn/295105/1434430435853p19ntbd8v81bd08lrvsu1lfs9gh15.jpg"}},{"id":10663277,"row_order":7340032,"layout":"topHeavy","col":4,"description":null,"updated_at":1434435486,"photo":{"id":9836317,"image_width":1600,"image_height":1066,"image_file_size":361453,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430063566,"url":"http://p.chanyouji.cn/295105/1434430437384p19ntbd8v87mhu7ms5oprauql16.jpg"}},{"id":10663278,"row_order":7864320,"layout":"topHeavy","col":4,"description":null,"updated_at":1434435486,"photo":{"id":9836318,"image_width":1066,"image_height":1600,"image_file_size":320852,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430063878,"url":"http://p.chanyouji.cn/295105/1434430438649p19ntbd8v8sat1qoo1b1hn9921j17.jpg"}},{"id":10663279,"row_order":8126464,"layout":"full","col":5,"description":null,"updated_at":1434435486,"photo":{"id":9836319,"image_width":1066,"image_height":1600,"image_file_size":349674,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430063888,"url":"http://p.chanyouji.cn/295105/1434430439889p19ntbd8v8uf7jnnjurvr5l2r18.jpg"}},{"id":10663975,"row_order":8192000,"layout":"full","col":6,"description":"参观卢浮宫，最早见到的是玻璃金字塔，而当初建它的目的，正是为卢浮宫设立一个清晰明了的主入口（现在主入口是清晰了，不过多数人都没有意识到其实 还有其它入口\u2026\u2026）。网上介绍说，这个主入口建筑要求\u201c大而突出，但又不能太突出\u201d，一方面要让方便游客找到，另一方面又不能抢宫殿的风头。当时，法国总 统密特朗走访了多座博物馆，最终\u201c钦点\u201d贝聿铭负责此项工程，亦一直支持他至金字塔完工。而贝聿铭在巴黎住下半年之后，选择在一个距离卢浮宫东、南、北侧 宫殿相等的位置（却不在巴黎轴线上）建金字塔。全玻璃的建筑采光良好，本身的透明度亦可以降低对周遭建筑的影响；而金字塔形状简洁，不会有过多柱和梁结 构，只需要小型骨架即可支撑，同样可以降低对周围的影响，亦能增进采光。法国人本来没被钦点就不爽，现在看到这个不在轴线上的金字塔设计，就更不爽了，为 此贝聿铭还在实地建了个1:1的骨架，解释他的概念。又因为密特朗的大力支持，这座\u201c让贝聿铭一生自豪的建筑\u201d才得以开工建成。","updated_at":1434435571},{"id":10663280,"row_order":8257536,"layout":"bottomHeavy","col":7,"description":null,"updated_at":1434435588,"photo":{"id":9836320,"image_width":1059,"image_height":1600,"image_file_size":206598,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430064103,"url":"http://p.chanyouji.cn/295105/1434430441151p19ntbd8v8idgs3r9ij12sj1p9n19.jpg"}},{"id":10663281,"row_order":8323072,"layout":"bottomHeavy","col":7,"description":null,"updated_at":1434435588,"photo":{"id":9836321,"image_width":1600,"image_height":1078,"image_file_size":144277,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430066222,"url":"http://p.chanyouji.cn/295105/1434430442526p19ntbd8v8sdvjvvntuaf61qq1a.jpg"}},{"id":10663282,"row_order":8355840,"layout":"bottomHeavy","col":7,"description":null,"updated_at":1434435588,"photo":{"id":9836322,"image_width":1600,"image_height":1066,"image_file_size":600599,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430067043,"url":"http://p.chanyouji.cn/295105/1434430444169p19ntbd8v8cu3qvs4drk06eo1b.jpg"}},{"id":10663607,"row_order":8364032,"layout":"bottomHeavy","col":8,"description":null,"updated_at":1434435571,"photo":{"id":9836599,"image_width":1600,"image_height":1200,"image_file_size":362507,"exif_lat":"48.8603166667","exif_lng":"2.3356","exif_date_time_original":1430042348,"url":"http://p.chanyouji.cn/295105/1434432220755p19ntd54b11fn1umq1v4dbu4rca7.jpg"}},{"id":10663283,"row_order":8372224,"layout":"bottomHeavy","col":8,"description":null,"updated_at":1434435571,"photo":{"id":9836323,"image_width":1600,"image_height":1066,"image_file_size":261210,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430068895,"url":"http://p.chanyouji.cn/295105/1434430445536p19ntbd8v8rga1mam1eg6fql8qb1c.jpg"}},{"id":10663284,"row_order":8380416,"layout":"full","col":9,"description":null,"updated_at":1434435571,"photo":{"id":9836324,"image_width":1066,"image_height":1600,"image_file_size":312635,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430069225,"url":"http://p.chanyouji.cn/295105/1434430446607p19ntbd8v8729g4p1rso1c6717b81d.jpg"}},{"id":10663285,"row_order":8384512,"layout":"full","col":10,"description":null,"updated_at":1434435571,"photo":{"id":9836325,"image_width":1600,"image_height":1066,"image_file_size":264262,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430069400,"url":"http://p.chanyouji.cn/295105/1434430448176p19ntbd8v82v7qp2k121j6jru81e.jpg"}},{"id":10663286,"row_order":8386560,"layout":"full","col":11,"description":null,"updated_at":1434435571,"photo":{"id":9836326,"image_width":1600,"image_height":1066,"image_file_size":231322,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430069600,"url":"http://p.chanyouji.cn/295105/1434430449379p19ntbd8v8liq11tko9n68156l1f.jpg"}},{"id":10663287,"row_order":8387584,"layout":"full","col":12,"description":null,"updated_at":1434435571,"photo":{"id":9836327,"image_width":1600,"image_height":1066,"image_file_size":303199,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430069740,"url":"http://p.chanyouji.cn/295105/1434430450417p19ntbd8v821m1ibp1uc61a01plt1g.jpg"}}]},{"id":1900713,"row_order":6291456,"score":4,"comment":"从市区去蒙马特高地，可以地铁绿线到Abbesses站，出地铁站就能看到爱墙（Le mur des je t'aime），这座墙上集合了超过250种语言的\u201c我爱你\u201d，成为爱情、浪漫、追求和平与世界大同的象征。\r\n从爱墙步行不远上山就能抵达圣心堂，而下山时 从圣心堂正面走，穿过蒙马特略脏乱的街区，就能从Anvers地铁站成蓝线走人。","tips":null,"memo":{"time_unit":"minute","price_amount":"","time":"","price_currency":"CNY"},"entry_id":94185,"lat":48.886676,"lng":2.340625,"entry_type":"Attraction","user_entry":false,"entry_name":"蒙马特高地","attraction_type":null,"updated_at":1486816222,"notes":[{"id":10663981,"row_order":-4194303,"layout":"full","col":0,"description":"蒙马特高地（Montmartre）是巴黎城市北部的一座山丘，1976年著名公路短片C'était un rendez-vous里，导演Claude Lelouch亲自驾驶一辆奔驰450SEL，大清晨高速横贯巴黎，最后冲上蒙马特，在圣心堂前迎着教堂钟声、车灯与晨光，给女友一个拥抱。\r\n行走在蒙马特高地，谁会想到100多年前这里还是一片遍布葡萄园和风车磨坊的小村落，后来巴黎城市改造，这里划归巴黎，成为了现在赫赫有名的巴黎十八区，也成为了巴黎最年轻的一个区。现在回想蒙马特的一切，曲径通幽的蜿蜒小径，灯红酒绿夜夜笙歌的红磨坊，洁白神圣的圣心教堂，聚集着怀揣梦想的画家们的小丘广场，写满了爱情的巴黎爱墙，脑袋里面闪过的都是一幅幅美妙绝伦色彩绚丽的图画。\r\n\r\n","updated_at":1434439237},{"id":10663290,"row_order":0,"layout":"equally","col":1,"description":null,"updated_at":1434439237,"photo":{"id":9836330,"image_width":1066,"image_height":1600,"image_file_size":507775,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430073070,"url":"http://p.chanyouji.cn/295105/1434430454507p19ntbd8v84v4ov9j71l1n1h791j.jpg"}},{"id":10663291,"row_order":4194304,"layout":"equally","col":1,"description":null,"updated_at":1434439237,"photo":{"id":9836331,"image_width":1600,"image_height":1066,"image_file_size":467913,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430073294,"url":"http://p.chanyouji.cn/295105/1434430456087p19ntbd8v86a01scv27t1f3n11un1k.jpg"}},{"id":10663292,"row_order":6291456,"layout":"full","col":2,"description":null,"updated_at":1434439237,"photo":{"id":9836332,"image_width":1600,"image_height":1066,"image_file_size":403810,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430073317,"url":"http://p.chanyouji.cn/295105/1434430457518p19ntbd8v82tig8i1msp1ejvqqa1l.jpg"}},{"id":10663293,"row_order":7340032,"layout":"full","col":3,"description":null,"updated_at":1434439237,"photo":{"id":9836333,"image_width":1600,"image_height":1066,"image_file_size":228972,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430073573,"url":"http://p.chanyouji.cn/295105/1434430458685p19ntbd8v89i61gdd1n7bgef6ph1m.jpg"}}]},{"id":1900714,"row_order":7340032,"score":0,"comment":null,"tips":null,"memo":{},"entry_id":157585,"lat":48.884744,"lng":2.338633,"entry_type":"Attraction","user_entry":false,"entry_name":"巴黎爱墙","attraction_type":null,"updated_at":1434438910,"notes":[{"id":10663983,"row_order":-4194303,"layout":"full","col":0,"description":"就是坐地铁到 ABBESSES 这一站下来，出来是个小广场，旁边有个小教堂，虽说没有圣心宏伟，但是也很漂亮。\r\n爱墙也在这里，三百多种语言写的我爱你，情侣们还是很喜欢的，然后从这里半山慢慢往上爬，一路上会看到很漂亮的咖啡馆，会路过全是画家的小广场，然后从侧面就可以走到圣心教堂正前方，心情不是一般的好呢。","updated_at":1434435919},{"id":10663288,"row_order":0,"layout":"full","col":1,"description":null,"updated_at":1434435919,"photo":{"id":9836328,"image_width":1600,"image_height":1009,"image_file_size":461007,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430072837,"url":"http://p.chanyouji.cn/295105/1434430451517p19ntbd8v81i4i1fmv1oinjf9f6k1h.jpg"}},{"id":10663289,"row_order":4194304,"layout":"full","col":2,"description":null,"updated_at":1434435919,"photo":{"id":9836329,"image_width":1600,"image_height":1066,"image_file_size":461143,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430072850,"url":"http://p.chanyouji.cn/295105/1434430452807p19ntbd8v816mjjtrbueh11tki1i.jpg"}}]},{"id":1900715,"row_order":7864320,"score":5,"comment":"白色的圣心大教堂是一座比较现代的教堂，建成于1914。教堂建筑缘起法国大革命，有多位巴黎公社成员命丧战争，蒙马特作为巴黎公社首次起义的地点，有巨 大的象征意义。其后政府几经交替，枢机主教也一换再换，各种势力角力博弈，终于1873年7月24由国民议会拍板开建，建筑师是Paul Abadie。","tips":null,"memo":{"time_unit":"minute","price_amount":"","time":"","price_currency":"CNY"},"entry_id":94173,"lat":48.887182,"lng":2.3428,"entry_type":"Attraction","user_entry":false,"entry_name":"圣心大教堂","attraction_type":null,"updated_at":1486816222,"notes":[{"id":10663990,"row_order":-4194303,"layout":"full","col":0,"description":"在圣心大教堂内部，有一副金碧辉煌的巨型马赛克耶稣圣象，是世上最大的马赛克拼贴画之一。教堂内部去前听说不允许拍照，但是我们在那里时，并没有说不允许，只是不让停留在路中拍照。\r\n圣心堂官方的解释文字如是说： \r\n\u201c 大殿穹顶展示的中心人物是耶稣，他伸展双臂欢迎所有到来的人。\r\n他认识所有人，他爱所有人，无论你信不信。他，就是爱本身。\r\n 耶稣胸口鲜红的圣心表述了他对我们的大爱。因此本教堂称为圣心大殿。\r\n圣心大殿有一个特殊使命：\r\n120年以来，直到今天，一直有人在这里日以继夜地祈祷。\r\n 耶稣对我们说：\u2018哀伤的人啊，到我这里来，我要安慰你们。\u2019\r\n  我们都要去他这里去，请求他的帮助。\u201d\r\n","updated_at":1434436055},{"id":10663294,"row_order":0,"layout":"full","col":1,"description":null,"updated_at":1434436055,"photo":{"id":9836334,"image_width":1600,"image_height":1066,"image_file_size":401541,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430075062,"url":"http://p.chanyouji.cn/295105/1434430459893p19ntbd8v8mvv15nm1ebb1n5c1gvv1n.jpg"}},{"id":10663295,"row_order":4194304,"layout":"bottomHeavy","col":2,"description":null,"updated_at":1434436055,"photo":{"id":9836335,"image_width":1600,"image_height":1066,"image_file_size":394031,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430076665,"url":"http://p.chanyouji.cn/295105/1434430461201p19ntbd8v813t31gpbsqcbq1o9a1o.jpg"}},{"id":10663296,"row_order":6291456,"layout":"bottomHeavy","col":2,"description":null,"updated_at":1434436055,"photo":{"id":9836336,"image_width":1600,"image_height":1066,"image_file_size":382102,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430076841,"url":"http://p.chanyouji.cn/295105/1434430462777p19ntbd8v815891kb2k2vurcfug1p.jpg"}},{"id":10663297,"row_order":7340032,"layout":"full","col":3,"description":null,"updated_at":1434436055,"photo":{"id":9836337,"image_width":1600,"image_height":1119,"image_file_size":377596,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430077084,"url":"http://p.chanyouji.cn/295105/1434430464152p19ntbd8v8qdc1n0e1rjvelq17151q.jpg"}},{"id":10674344,"row_order":7602176,"layout":"full","col":4,"description":"浅灰色的石墙很清丽，据说用的是一种特殊的石材，接触 雨水后会分泌一种白色的物质，因此经历一百多年的风雨洗礼后反而越来越白。厚重的墙体和醒目的圆穹顶据说是拜占庭和罗马风格的混合，我是外行，只能鹦鹉学舌。\r\n出教堂，刚才还阴沉的天一下子就开朗了，阳光下的圣心大教堂更加亮丽，教堂前广场上人头涌涌，都是世界各地的游客。有一艺人坐在台阶上弹拨着竖琴，铿锵的乐声令不少人停下脚步。","updated_at":1434527058},{"id":10663298,"row_order":7864320,"layout":"full","col":5,"description":null,"updated_at":1434527005,"photo":{"id":9836338,"image_width":1600,"image_height":1066,"image_file_size":297410,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430077677,"url":"http://p.chanyouji.cn/295105/1434430465560p19ntbd8v81v201mqt1g8sabm10fm1r.jpg"}},{"id":10663982,"row_order":8126464,"layout":"full","col":6,"description":"蒙马特就好像一本精彩的画册，当你怀着希望打开第一页的时候，你会发现里面的内容绝对要比你想象中的还要精彩，你会狠不得一口把它读完读懂，当 你满足的看完最后一页的时候，你回过头来仔细回想前面的内容，你会发现，它根本不是一遍或者几遍就能读完读懂的，但是你并没有因此失望，蒙马特就好像有一 种魔法一样，让你忍不住又想看第二遍第三遍。神奇的是当你走火入魔般的一次又一次了解它的时候，每一次却得到不一样的收获，这就是蒙马特。一个聚集了无数 人梦想和带走无数人灵魂的地方。","updated_at":1434527005}]},{"id":1900716,"row_order":8126464,"score":0,"comment":null,"tips":null,"memo":{},"entry_id":363747,"lat":0,"lng":0,"entry_type":"Attraction","user_entry":true,"entry_name":"triumphal arch","attraction_type":null,"updated_at":1434438910,"notes":[{"id":10663811,"row_order":-4194303,"layout":"full","col":0,"description":"\u2022  门票： 成人：9.50欧，优惠价6欧（18岁以下免费)；11月1日到3月31日之间的每个月第一个星期天免费。\r\n\u2022  到达方式： \r\n地铁：M1/M2/M6线，Charles-de-Gaulle-Etoile站；\r\n城铁：RER A线，Charles-de-Gaulle-Etoile站；\r\n公交：22/30/31/52/73/92，Balabus站\r\n","updated_at":1434439237},{"id":10663299,"row_order":0,"layout":"topHeavy","col":1,"description":null,"updated_at":1434439237,"photo":{"id":9836339,"image_width":1066,"image_height":1600,"image_file_size":218845,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430080891,"url":"http://p.chanyouji.cn/295105/1434430467884p19ntbd8v8l69p4s1vks1j831jnd1s.jpg"}},{"id":10663300,"row_order":4194304,"layout":"topHeavy","col":1,"description":null,"updated_at":1434439237,"photo":{"id":9836340,"image_width":1066,"image_height":1600,"image_file_size":244993,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430080956,"url":"http://p.chanyouji.cn/295105/1434430468950p19ntbd8v8h5geis1l931m371sji1t.jpg"}},{"id":10663303,"row_order":6291456,"layout":"full","col":2,"description":null,"updated_at":1434439237,"photo":{"id":9836343,"image_width":1600,"image_height":1066,"image_file_size":376415,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430082467,"url":"http://p.chanyouji.cn/295105/1434430472901p19ntbd8v81l7rhrr1hq7udfgn20.jpg"}}]},{"id":1900717,"row_order":8257536,"score":0,"comment":null,"tips":null,"memo":{},"entry_id":94209,"lat":48.869576,"lng":2.30825,"entry_type":"Attraction","user_entry":false,"entry_name":"香榭丽舍大街","attraction_type":null,"updated_at":1434438910,"notes":[{"id":10663808,"row_order":-4194303,"layout":"full","col":0,"description":"博物馆通票在此刻又发挥了作用，我们顺着北侧的楼梯闷头爬上了凯旋门顶端，首先吸引到我的是四周别具风格的护栏。很掉价的那会下着漂泊大雨，La defanse方向一片大好的景色却也无法挽回人们对于铁塔的热情。北侧和南侧各有一个观景台，原本是让游客可以站在这里，根据地图了解四周的风景和建筑，但是却被擅于利用环境的机智的游客朋友用作了合影用途。凯旋门为中心四处发散有十二条大道，其中正对卢浮宫连接协和广场的就是有名的$香榭丽舍大道$，这条近2公里长的大道被誉为全球最美丽的街道之一。","updated_at":1434434875},{"id":10663301,"row_order":0,"layout":"full","col":1,"description":null,"updated_at":1434434875,"photo":{"id":9836341,"image_width":1600,"image_height":1066,"image_file_size":466443,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430081742,"url":"http://p.chanyouji.cn/295105/1434430469889p19ntbd8v81s3s12tr1et99fv11np1u.jpg"}},{"id":10663302,"row_order":4194304,"layout":"full","col":2,"description":null,"updated_at":1434434875,"photo":{"id":9836342,"image_width":1600,"image_height":1066,"image_file_size":360015,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1430081854,"url":"http://p.chanyouji.cn/295105/1434430471607p19ntbd8v813cokv5477ebc1pj71v.jpg"}}]},{"id":1900753,"row_order":8323072,"score":0,"comment":null,"tips":null,"memo":{},"entry_id":94248,"lat":48.857063,"lng":2.341308,"entry_type":"Attraction","user_entry":false,"entry_name":"巴黎新桥","attraction_type":null,"updated_at":1434438910,"notes":[{"id":10664705,"row_order":-4194303,"layout":"full","col":0,"description":"新桥则是最有名的桥，它名叫新桥，实际最古老。但同时也是巴黎塞纳河上最长的桥。桥有新桥横跨西岱岛，桥下的岛像尖刀似的伸向塞纳河，将河一劈为二。新桥建成后整整两个世纪，一直是巴黎的商业中心，桥上热热闹闹，有书商、自编自演的艺术家、流动摊贩，甚至拔牙者。直到今天，新桥仍激发着艺术家的创作热情。从桥上走过，见桥两边的人行道还建有半圆形石椅，椅面凹凸不平，记载着岁月沧桑。这座巴黎最古老的桥却叫新桥，已有近400年历史了。\r\n","updated_at":1434440324},{"id":10663608,"row_order":0,"layout":"full","col":1,"description":null,"updated_at":1434440324,"photo":{"id":9836600,"image_width":1200,"image_height":1600,"image_file_size":359551,"exif_lat":"48.8581583333","exif_lng":"2.341975","exif_date_time_original":1430077582,"url":"http://p.chanyouji.cn/295105/1434432222018p19ntd54b1f2t16n4ugs1rvf1f4d8.jpg"}},{"id":10663602,"row_order":4194304,"layout":"full","col":2,"description":null,"updated_at":1434440324,"photo":{"id":9836594,"image_width":1200,"image_height":1600,"image_file_size":306346,"exif_lat":"48.8610638889","exif_lng":"2.2933777778","exif_date_time_original":1430079473,"url":"http://p.chanyouji.cn/295105/1434432213361p19ntd54b1nf510cqql379c1p8i2.jpg"}},{"id":10664698,"row_order":6291456,"layout":"full","col":3,"description":"\u201d在巴黎除了做梦，什么也不能做。\"大概就是这样的城市吧，你一进入，思想的空白便被瞬间占据。无论是眼睛、耳朵、鼻子，所感受到的全部都是这个城市。这里也不会有重复，真正吸引的力量是不会重复的。","updated_at":1434440324}]}]}]
//     * tip : {"id":16076,"texts":["作为欧洲数一数二的大城市，巴黎是怎么呆都玩不够的。所以当我看到网上有人写巴黎一天游（Go2EU: 一天也可以精彩），顿时就觉得如此的神奇强大。","从攻略的角度看，两三天游巴黎很累很紧凑，不过想想即使多去两三天也还是会有遗憾。大抵最理想的安排，还是事前多做功课，想明白自己为什么要去巴黎，去到后能看什么。","欧洲周日全部都放假，包括商场以及针对游客的老佛爷。餐厅有些也会提前停止营业。"]}
