//         * nodes : [{"id":1900752,"row_order":0,"score":0,"comment":null,"tips":null,"memo":{},"entry_id":null,"lat":0,"lng":0,"entry_type":null,"user_entry":false,"entry_name":null,"attraction_type":null,"updated_at":1434438909,"notes":[{"id":10663619,"row_order":0,"layout":"full","col":0,"description":"陈丹燕的一段话，想放在这里做开篇。\r\n\u201c有时我要长风万里，有时我要归于内心。有时我要抹去自己身上所有身份的痕迹，就渴望当一个透明的人。有时万里、十万里之外，竟然回到的是自己的内心。\u201d\r\n\r\n曾经对巴黎的场景幻想，是身后有怀抱，耳边有软语。\r\n这么多年过去，错的人对的人轮番走过，有时难免孤独，但错过的人也许注定远航\r\n那你又怎能停留在原地\r\n疗伤不如旅行，治愈不如开阔。\r\n走在大地的脉络间，我守着自己的生命轨迹。\r\n温柔笃定的，想你。","updated_at":1434433056}]},{"id":1900755,"row_order":4194304,"score":0,"comment":null,"tips":null,"memo":{},"entry_id":363757,"lat":0,"lng":0,"entry_type":"Attraction","user_entry":true,"entry_name":"迪拜机场","attraction_type":null,"updated_at":1434438909,"notes":[{"id":10663651,"row_order":-4194303,"layout":"full","col":0,"description":"北京飞迪拜9个小时，迪拜飞巴黎6个小时，飞过欧亚大陆，一路追过6小时时差，奔向亚平年半岛，一路昏睡，偶尔醒来时，黑暗正好，一直期待黎明。\r\n\r\n","updated_at":1434433166},{"id":10663603,"row_order":0,"layout":"full","col":1,"description":null,"updated_at":1434433134,"photo":{"id":9836595,"image_width":1600,"image_height":1066,"image_file_size":351459,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429865971,"url":"http://p.chanyouji.cn/295105/1434432215182p19ntd54b11i35f2q1uuq156c14al3.jpg"}}]},{"id":1900756,"row_order":6291456,"score":0,"comment":null,"tips":null,"memo":{},"entry_id":363758,"lat":0,"lng":0,"entry_type":"Attraction","user_entry":true,"entry_name":"chalete 夏特勒","attraction_type":null,"updated_at":1434438909,"notes":[{"id":10663652,"row_order":-4194303,"layout":"full","col":0,"description":"机长的广播把我们从恍惚中唤醒，活动下酸痛不已的四肢，望眼四周，全是些惺忪茫然的眼神，十几小时的飞行总算要结束了。拉开遮光板，天际线上晕染出一段好看的橘黄色，想拿出相机给它留下一个美丽的回忆，想想还是作罢了。迎着法兰西的艳阳，我们稳稳的降落在CHARLES DE GAULLE AIRPORT，一切都很顺利，远比其它地方的入境简单轻松，甚至连机场海关的人都知道用中文\u201c你好\u201d跟我们打招呼，希望不久中文能成国际通用语言就好了。当地时间下午13：30到达，如此正好是犯困的北京时间，少女之心浪漫的起点之地啊啊啊，心里真是乱激动一把，我甚至想到十年前我在电视里看到的那以为遥不可及的铁塔，而现在我终于站在了铁塔所在的地方，巴黎！","updated_at":1434433194},{"id":10663606,"row_order":0,"layout":"full","col":1,"description":null,"updated_at":1434433194,"photo":{"id":9836598,"image_width":1200,"image_height":1600,"image_file_size":463193,"exif_lat":"48.8645027778","exif_lng":"2.3466444444","exif_date_time_original":1430035206,"url":"http://p.chanyouji.cn/295105/1434432219358p19ntd54b1kjd5g41go412p41ntj6.jpg"}},{"id":10663768,"row_order":3145728,"layout":"full","col":2,"description":"在铁塔附近，还是卢浮宫附近? \r\n因为这回只有三天的时间在巴黎，考虑到要去的地方都集中在地铁1、2、4，7，就把房间订在所在的夏特勒区，Airbnb 上订的民宿： Feel at home in the heart of Paris!\r\nhttps://zh.airbnb.com/rooms/1876098 \r\n这个街区晚上还蛮不错，宁静安全，楼下的美食街基本各国美食都有，中餐，日料，意大利餐......超市，药房，花店。","updated_at":1471893860},{"id":10663537,"row_order":4194304,"layout":"full","col":3,"description":null,"updated_at":1434439237,"photo":{"id":9836567,"image_width":1187,"image_height":592,"image_file_size":119634,"exif_lat":"0.0","exif_lng":"0.0","exif_date_time_original":0,"url":"http://p.chanyouji.cn/295105/1434431768713p19ntcni388877b1mfv3ktt9a2.jpg"}},{"id":10663803,"row_order":5242880,"layout":"full","col":4,"description":"在戴高乐机场T2买了博物馆的通票。\r\n比较受欢迎的景点可以用通票的包括：巴黎圣母院（钟楼、但是需要排队）、卢浮宫、奥赛博物馆、蓬皮杜中心、凯旋门。\r\n大部分可以使用通票的景点都允许通票持有者直接进入而不用排队，排除的大部分都是在买票的。\r\n","updated_at":1434529033},{"id":10663769,"row_order":6291456,"layout":"full","col":5,"description":"\"到 了巴黎这个城市，我认为最惬意的事就是在城里乱逛了。走在大街上看房子，看人，看街旁的雕塑，看看商店的橱窗，逛逛塞纳河两岸无数文豪驻足过的旧书摊，再 随意坐在路旁露天的咖啡馆吃点喝点。或者干脆随便登上一艘塞纳河上的游船，来一次浪漫之旅，看两岸古老的建筑一一划过，倾听伴着舒缓的古典音乐传来的导游 优雅的解说。然而，如果只是这样的话，回来讲给朋友听，我这样的旅行一定会被视为浪费。在巴黎这样一个艺术之都，如果说真的只有闲逛，那恐怕连我自己也会后悔。\"\r\n哈哈，不过第一天我们什么也没干，本想塞纳河上的日落，还是被可恶的时差打败，吃过饭就回去睡觉了。","updated_at":1434439237},{"id":10663232,"row_order":7340032,"layout":"full","col":6,"description":"楼下风景","updated_at":1434439237,"photo":{"id":9836272,"image_width":1600,"image_height":1061,"image_file_size":402286,"exif_lat":null,"exif_lng":null,"exif_date_time_original":1429979987,"url":"http://p.chanyouji.cn/295105/1434430383135p19ntbd8v71pfn17vlsnbfo01tb42.jpg"}}]}]
